import { createSelector } from 'reselect';
import { useSelector } from "react-redux";

const selectCurrentAssetStatus = createSelector(
    state => state.assetData,
    assetData => (assetData.status)
);

export const CurrentAssetStatus = () => {
    const assetStatus = useSelector(selectCurrentAssetStatus)
    return `${assetStatus}`
};
